    false,nt"url": null,nt"notes": "This collections covers Panther Swamp National
    Wildlife Refuge's hunting plan and memos (specifically Mike Espy) between the refuge
    on the local community. The local community expressed distress as Panther Swamp
    altered their hunting regulations to increase average buck age and doe fertility.
    The hunting plan provides guidelines for the administration of hunting activity
    and for the development, maintenance, and enforcement of regulations and guidelines
    on Panther Swamp. It specifically addresses the areas of information, access, use
    patterns, regulations, area restrictions, permits, and enforcement. Target species
    include small game, big game, and migratory species.",nt"license_title": "License
